import React from 'react'
import Head from 'next/head'

const MyApp = ({ Component, pageProps }) => 
{
    return (
        <>
        <Head>
            <meta name="viewport" content="viewport-fit=cover" />
           
        </Head>
        </>
    )
}

export default MyApp;
